A spectacular combination of NiT GriT's legendary sound-design and exemplary melodicism is flawlessly fused with Stephan Jacobs fierce break-down style and intricate, inter-galactic progressions to form "Game Over", by far the best track to emerge from this outstanding Dubstep collaboration. Bridging the gap between Glitch, IDM, Dubstep, and "Bass Music" in general, NiT GriT and Stephan Jacobs stand strong as two of the industries most exciting rising artists.&#13;
&#13;
-Ethan Baer ( Dubstep.NET )&#13;
